class Livro{
    codigo: number; 
    codEditora: number; 
    titulo: string;
    autores: string[];

    constructor(codigo: number, codEditora: number, titulo: string, autores: string[]){
        this.codigo = codigo;
        this.autores = autores;
        this.codEditora = codEditora;
        this.titulo = titulo;
    }

    getCodigo(): number{
        return this.codigo;
    }
    getCodEditora(): number{
        return this.codEditora;
    }

    getTitulo(): string{
        return this.titulo;
    }
    getAutores():string[]{
        return this.autores;
    }

    setCodigo(codigo:number): void{
        this.codigo = codigo;
    }
    setCodEditora(codEditora: number): void{
        this.codEditora = codEditora;
    }
    setTitulo(titulo: string): void{
        this.titulo = titulo;
    }
    setAutores(autores: string[]): void {
        this.autores = autores;
    }

}

export default Livro;
